interface labels {
    subTitle :string,
    loadingMessage:string,
    errorMessage:string
}

const MyLabels : labels = {
    subTitle :'SPA using Typescript',
    loadingMessage:"Loading !!!",
    errorMessage: "Oops something went wrong !"
}


export default MyLabels;
